import React from "react";
import "./_videoMetaData.scss";

const VideoMetaData = () => {
  return (
    <div className="videoMetaData py-2">
      <h5>
        <div className="d-flex justify-content-between align-items-center py-1"></div>
      </h5>
      <div className="videoMetaData_top"></div>
      <div className="videoMetaData_channel"></div>
      <div className="videoMetaData_description"></div>
    </div>
  );
};

export default VideoMetaData;
